('RADIOLOGY', 'US NECK', 'US NECK', '', 'US NECK', '', '', '', '', 'The right lobe of the thyroid measures        cms with a volume of       cc.\n\nThe left lobe of the thyroid measures        cms with a volume of      cc.\n\nBoth the lobes of the thyroid gland appear normal in size with normal echo texture.\n\nNo focal lesion is noted the thyroid.\n\nBoth the parotid gland appears normal in size and echo texture.\n\nNo evidence any intraparotid lymph nodes notes.\n\nBoth the submandibular glands appears normal in size and echo texture.\n\nNo evidence of any dilatation of the submandibular and parotid ducts.\n\nNo evidence of any cervical lymph nodes.\n\nNo evidence of any supraclavicular lymph nodes noted.\n\nThe trachea is in midline.\n\nThe carotid vessel are normal.\n\nIMPRESSION:\n\n                   Normal sonographic study of neck.\n', '', '2500.00', '500.00', NULL, 1),
('RADIOLOGY', 'US THYROID', 'US THYROID', '', 'US THYROID', '', '', '', '', 'The right lobe of the thyroid measures.\n\nThe left lobe of the thyroid measures.\n\nBoth lobes of the thyroid are normal in size.\n\nTh echotexture is homogenous. There is no nodule or cyst or calcification.\n\nThe trachea is in the midline.\n\nNo lymphadenopathy is seen.\n\nThe carotid vessel are normal.\n\n\nIMPRESSION:\n\n              Normal Study\n', '', '2500.00', '500.00', NULL, 1),
('RADIOLOGY', 'US OBS (2ND TRIMESTER)', 'US OBS (2ND TRIMESTER)', '', 'US OBS (2ND TRIMESTER)', '', '', '', '', 'LMP  \nEDD  					                                        EDD BY USG  \nCLINICAL GA  				                                GA BY USG  \n\nUltrasound of pelvis shows enlarged gravid uterus containing single live intrauterine fetus in cephalic presentation with following parameters.\n\nFetal Biometry:\n\nBPD -            mm corresponding to 19 weeks 6days\nHC   -            mm corresponding to 19weeks 4days\nAC	-            mm corresponding to 19weeks 2days\nFL	-            mm corresponding to 19weeks 5 day\n\nFetal heart rate      bpm and regular.\n\nFetal tone and movements are normal.\n\nPlacenta is anterior, fundal & body. Grade     in maturity.\n\nLiquor is adequate. \n\nEstimated fetal weight         gm.\n\nSpine is towards right.\n\nUmbilical cord is normal. No cord around neck seen.\n\nCervical length is normal measuring       cm.\n\nBoth adnexae appear normal\n.\nIMPRESSION:\n\n	SINGLE LIVE INTRAUTERINE FETUS  WEEKS GESTATIONAL AGE.\n\n--Suggested Anomaly scan between 20  24 weeks.\n', '', '2000.00', '400.00', NULL, 1),
