('RADIOLOGY', 'DOP CAROTID-VERTIBRAL STUDY', 'DOP CAROTID-VERTIBRAL STUDY', '', 'DOP CAROTID-VERTIBRAL STUDY', '', '', '', '', '\nBilateral carotid and vertebral arterial Doppler has done with 2D Grey scale; Color and Pulsed wave duplex Doppler.\n\n2D GREY SCALE:\nBoth common carotid arteries appear normal.  Bilateral carotid bulbs are normal.\nBilateral internal and external carotid arteries are normal.\nBilateral vertebral arteries are normal.\nIntima-media complexes in both common carotid arteries and carotid bulbs are normal.  \nNo plaques seen.  No dissection noted. No thrombus seen.\n\nCOLOUR DOPPLER STUDY:\nBilateral CCA, ICA, ECA and left vertebral arteries are showing antegrade flow with complete luminal color filling of homogenous hue. \n\nFlow separation is preserved at bilateral carotid bulbs and proximal ICAs\nNo aliasing noted to suggest turbulence.\n\n\nPULSED WAVE DOPPLER STUDY: \nThe blood flow velocity and wave patterns are normal within the vessels.\nThe velocity measurements (cm/sec) from spectral wave tracings are as follows:\n\nRIGHT SIDE						LEFT SIDE\n\nRight	PSV cm/s	EDV cm/s	R.I       Left	  PSV cm/s	   EDV', '', '3800.00', '760.00', NULL, 1),
('RADIOLOGY', 'COLOUR DOPPLERL-PENILE', 'COLOUR DOPPLERL-PENILE', '', 'COLOUR DOPPLERL-PENILE', '', '', '', '', 'Done with 7.5 MHz linear probe in both flaccid and erect state using 1.5 cc of papaverine. Subtotal erection achieved and the study continued till 20 minutes.\n\nFINDINGS:\n\nBilateral corpora cavernosa and spongiosum show normal echo texture. No calcification plaque seen.\n\nBilateral deep penile arteries show normal high resistance systolic flow with absent diastolic flow in flaccid state. No asymmetry in flow seen.\n\nDoppler study in erect state as follows.\n\nRIGHT DEEP PENILE ARTERY \n\n	                PSV cm/s         	        EDV cm/s	                      R.I\n10 min	\n15 min	\n20 min			\n\nLEFT  DEEP PENILE ARTERY \n\n	                PSV cm/s	                 EDV cm/s                              R.I\n10 min			\n15 min			\n20 min			\n\nVenous flow is normal.\n\nIMPRESSION:\n	NO PENILE CALCIFICATION SEEN\n	NORMAL PENILE ERECTILE RESPONSE TO VASODILATOR INJECTION\n	NO EVIDENCE OF ARTERIAL OR VENOUS ERECTILE DYSFUNCTION SEEN\nPlease correlate\n', '', '3800.00', '760.00', NULL, 1),
('RADIOLOGY', 'DOP-RENAL', 'DOP-RENAL', '', 'DOP-RENAL', '', '', '', '', 'Both renal arteries and renal parenchymal upper, mid and lower interlobar vessels were studied by Real time B.Mode sonography and co-related with pulsed doppler blood flow study.\n\nREAL TIME B. MODE:\n\nKidneys: Right kidney: cm. Left kidney: cm.  Both kidneys show normal size, outline and echotexture. No SOL seen. No suprarenal SOLs seen.\n\nBoth renal arteries were well visualized and show no evidence of narrowing.\n\nPULSED DOPPLER STUDY:\n\nBoth renal arteries show normal velocity waveform with steep systolic upstroke. There is no evidence of stenosis. The blood flow is symmetrical in corresponding segments of the arteries on each side.\n\nThe inter lobar vessels also show normal velocity waveform.\n\nThe following are the values obtained by spectral analysis of the flow velocity wave forms.\n\n	                              PSV (cm/s)	               EDV (cm/s)                         R.I\nRight renal artery			\nLeft renal artery			\n\n\nThe difference in RI values between bilateral corresponding inte', '', '3800.00', '760.00', NULL, 1),
('RADIOLOGY', 'COLOUR DOPPLER-SCROTAL', 'COLOUR DOPPLER-SCROTAL', '', 'COLOUR DOPPLER-SCROTAL', '', '', '', '', 'Scrotal wall is normal.\n\nRight testis measures                 mm, volume \nLeft testis measures                    mm, volume  .\n\nTESTIS: Bilateral testes are normal in size, outline and echotexture. No focal lesion seen. Bilateral intra testicular flow signal is normal.\nEPIDYDIMIS: The bilateral epididymis are normal in size, outline and echo texture.\nNo focal lesion seen. No abnormal flow signal noted.\n\nLeft pampniform plexus show few dilated veins largest 2.5 mm with reversal of flow during valsalva.\n\nBilateral spermatic cords appear normal.\n\nIMPRESSION:\n\n	LEFT  VARICOCELE SEEN\n\n	NORMAL DOPPLER STUDY OF BILATERAL TESTIS, RIGHT PAMPNIFORM PLEXUS AND BILATERAL EPIDIDYMIS\n', '', '3800.00', '760.00', NULL, 1),
('RADIOLOGY', 'US PELVIS', 'US PELVIS', '', 'US PELVIS', '', '', '', '', 'The uterus is anteverted,normal in size and measures         cms. \nMyometrial echoes are homogeneous. \nThe endometrium measures     mm and is normal. \nThe  right ovary measures             cm, volume  \nThe left ovary measures                  cm, volume  \nBoth ovaries appears normal.\nIliac fossae are normal.\nNo mass or fluid collection is seen in the right iliac fossa.  \nIMPRESSION: \n?	NORMAL ENDOMETRIAL THICKNESS.\n?	OTHERWISE NORMAL STUDY.\n', '', '1200.00', '240.00', NULL, 1),
('RADIOLOGY', 'US-THIGH', 'US-THIGH', '', 'US-THIGH', '', '', '', '', 'B-mode ultra sonogram of left thigh was done. \n\nSubcutaneous plane appears normal.\nMuscle plane appears normal.\nNo evidence of abnormal collection.\nNo evidence of abnormal calcification / lesion noted. \nIMPRESSION:\n	NO EVIDENCE OF HEMATOMA. \n	NO SIGNIFICANT SONOGRAPHIC ABNORMALITY DETECTED\n', '', '2000.00', '400.00', NULL, 1),
('RADIOLOGY', 'US KUB', 'US KUB(FEMALE)', '', 'US KUB(FEMALE)', '', '', '', '', '\nKIDNEYS: \n\nRight Kidney  measures 9.2 X 4.2 cm, normal in size and shape. The cortical thickness and echogenicity appear normal. The pelvicalyceal system is not dilated. A calculus of 4mm in middle calyx. No mass seen.\n\nLeft Kidney  measures 9.1 X 4.1 cm, normal in size and shape. The cortical thickness and echogenicity appear normal. The pelvicalyceal system and ureter dilated up to vesicoureteric calculus of ~6mm. Two calculi of 4 mm each in middle and lower calyces No mass seen.\n\nURINARY BLADDER: The Urinary bladder is adequately distended. No calculus / mass seen within. The wall appears normal. \n\nUTERUS: The Uterus is normal in size and measures 6.3 x 3.4 cm. Endometrial thickness measures 6 mm. Myometrial and endometrial echoes are homogenous. No focal lesion seen. Cervix appears normal.\n\nOVARIES: Bilateral ovaries appear enlarged and show few small peripheral cysts. Right ovary measures 2.4 x 3.0 x 2.7 cm, volume -9 cc. Left ovary measures 2.9 x 3.3 x 2.8 cm, volume  11cc\n\nI', '', '1200.00', '240.00', NULL, 1),
('RADIOLOGY', 'US KUB(MALE)', 'US KUB(MALE)', '', 'US KUB(MALE)', '', '', '', '', '\nKIDNEYS: \n\nRight Kidney  measures cm, normal in size and shape. The cortical thickness and echogenicity appear normal. The pelvicalyceal system is not dilated. No calculus / mass seen.\n\nLeft Kidney  measures cm, normal in size and shape. The cortical thickness and echogenicity appear normal. The pelvicalyceal system is not dilated. No calculus / mass seen.\n\nURINARY BLADDER: The Urinary bladder is adequately distended. No calculus / mass seen within. The wall appears normal. No uretero-vesical junction calculus seen.\n\nPROSTATE: The prostate is normal in size, shape and parenchymal echoes. No focal lesion seen. The prostate measures cm (volume - cc). The seminal vesicles are normal and show no cyst.\n\nNo free fluid or mass or cyst seen in pelvis.\n \nIMPRESSION:\n\n	NORMAL SONOGRAPHIC STUDY OF KUB AND PELVIC ORGANS\n', '', '1200.00', '240.00', NULL, 1),
