('RADIOLOGY', 'DOP CAROTID-VERTIBRAL STUDY', 'DOP CAROTID-VERTIBRAL STUDY', '', 'DOP CAROTID-VERTIBRAL STUDY', '', '', '', '', '\nBilateral carotid and vertebral arterial Doppler has done with 2D Grey scale; Color and Pulsed wave duplex Doppler.\n\n2D GREY SCALE:\nBoth common carotid arteries appear normal.  Bilateral carotid bulbs are normal.\nBilateral internal and external carotid arteries are normal.\nBilateral vertebral arteries are normal.\nIntima-media complexes in both common carotid arteries and carotid bulbs are normal.  \nNo plaques seen.  No dissection noted. No thrombus seen.\n\nCOLOUR DOPPLER STUDY:\nBilateral CCA, ICA, ECA and left vertebral arteries are showing antegrade flow with complete luminal color filling of homogenous hue. \n\nFlow separation is preserved at bilateral carotid bulbs and proximal ICAs\nNo aliasing noted to suggest turbulence.\n\n\nPULSED WAVE DOPPLER STUDY: \nThe blood flow velocity and wave patterns are normal within the vessels.\nThe velocity measurements (cm/sec) from spectral wave tracings are as follows:\n\nRIGHT SIDE						LEFT SIDE\n\nRight	PSV cm/s	EDV cm/s	R.I       Left	  PSV cm/s	   EDV', '', '3800.00', '760.00', NULL, 3),
('RADIOLOGY', 'COLOUR DOPPLERL-PENILE', 'COLOUR DOPPLERL-PENILE', '', 'COLOUR DOPPLERL-PENILE', '', '', '', '', 'Done with 7.5 MHz linear probe in both flaccid and erect state using 1.5 cc of papaverine. Subtotal erection achieved and the study continued till 20 minutes.\n\nFINDINGS:\n\nBilateral corpora cavernosa and spongiosum show normal echo texture. No calcification plaque seen.\n\nBilateral deep penile arteries show normal high resistance systolic flow with absent diastolic flow in flaccid state. No asymmetry in flow seen.\n\nDoppler study in erect state as follows.\n\nRIGHT DEEP PENILE ARTERY \n\n	                PSV cm/s         	        EDV cm/s	                      R.I\n10 min	\n15 min	\n20 min			\n\nLEFT  DEEP PENILE ARTERY \n\n	                PSV cm/s	                 EDV cm/s                              R.I\n10 min			\n15 min			\n20 min			\n\nVenous flow is normal.\n\nIMPRESSION:\n	NO PENILE CALCIFICATION SEEN\n	NORMAL PENILE ERECTILE RESPONSE TO VASODILATOR INJECTION\n	NO EVIDENCE OF ARTERIAL OR VENOUS ERECTILE DYSFUNCTION SEEN\nPlease correlate\n', '', '3800.00', '760.00', NULL, 3),
