('RADIOLOGY', 'DOP-LEFT UPPER LIMB VEINS', 'DOP-LEFT UPPER LIMB VEINS', '', 'DOP-LEFT UPPER LIMB VEINS', '', '', '', '', 'Left subclavian, axillary, brachial, interosseous, radial and ulnar veins and superficial veins were studied by Real time B mode sonography, color and pulsed Doppler.\n\nREAL TIME B.MODE:\n\nLeft subclavian, axillary, brachial, interosseous, radial and ulnar veins and superficial veins show patent lumen and are collapsible. No thrombus noted.\n\nCOLOR AND PULSE DOPPLER STUDY:\n\nLeft subclavian, axillary, brachial, interosseous, radial and ulnar veins and superficial veins show normal spontaneous phasic flow, flow augmentation and normal response to valsalva.\n\nLEFT UPPER LIMB VEINS:\n\nVessels 	    Spontaneous	    Phasic        Compressibility      Augmentation	Response\nStudied            Flow                   Flow                                                                         to valsalva\n\nSubclavian	  Present	   Present	        Present	            Present	          Normal\nAxillary	         Present	           Present	        Present	            Present	          Normal\nBrachial	       ', '', '0.00', '0.00', NULL, 3),
('RADIOLOGY', 'US COMPLETE ABDOMEN (MALE)', 'US COMPLETE ABDOMEN (MALE)', '', 'US COMPLETE ABDOMEN (MALE)', '', '', '', '', 'The liver is normal in size and shows fatty echo texture with no focal lesion\n	\nThe gall bladder is normal sized. \n\nThere is no intra or extra hepatic biliary ductal dilatation.\n\nThe pancreas shows a normal configuration and echotexture. \n\nThe pancreatic duct is normal.\n\nThe portal vein appears normal.\n\nIVC is normal.\n\nThe spleen is normal.\n \nThere is no free or loculated peritoneal fluid.\n\nNo para aortic lymphadenopathy is seen.\n\nNo abnormality is seen in the region of the adrenal glands.\n\nThe right kidney measures 9.2 X 4.5 cms. \n	\nThe left kidney measures 9.8 x 4.1cms. \n\nBoth kidneys are normal in size,shape and position. \n\nThere is no calyceal dilatation. \n\nThe ureters are not dilated.\n\nThe bladder is smooth walled and uniformly transonic. There is no intravesical mass or calculus.\n\nThe prostate is normal in size.3.4 X 3.0 X 3.1cm volume  13 cc.\n\nThe echotexture is homogeneous. \n\nThe seminal vesicles are normal.\n\nIliac fossae are normal.\n\nNo mass or fluid collection is seen in the', '', '1400.00', '280.00', NULL, 3),
('RADIOLOGY', 'Us transrectal', 'Us transrectal', '', 'Us transrectal', '', '', '', '', 'The bladder is smooth walled and uniformly transonic. There is no intravesical mass or calculus.\n\nThe prostate is  normal in size, shape and parenchymal echoes. \n\nThe prostate is normal in size.3.4 X 3.0 X 2.8 cm , volume  13cc.\n\nThe echotexture is homogeneous. \n\n\nThe seminal vesicles are normal.\n\nVisualised portion of rectum appears normal.\n\nIMPRESSION : \n                      \n?	NO SIGNIFICANT ABNORMALITY DETECTED\n', '', '4000.00', '800.00', NULL, 3);
